import { BrowserRouter as Router, Link } from "react-router-dom";
import styled from "styled-components";
import {
  NavigationBar,
  Container,
  Navlogo,
  NavBox,
  NavLogoText,
} from "./styles";

const Navbar = () => {
  return (
    <NavigationBar>
      <Container>
        <Navlogo>
          <NavBox>
            <NavLogoText>
              <Router>
                <Link to="/"> StarWars</Link>
              </Router>
            </NavLogoText>
          </NavBox>
        </Navlogo>

        <div className="ul-list">
          <ul>
            <li>
              <a href="homepage.html">Home</a>
            </li>
          </ul>
        </div>
      </Container>
    </NavigationBar>
  );
};

export default Navbar;
